INSERT INTO `email_copies` (`id`, `date_created`, `body`, `subject`) VALUES
('197127dd392dd3e5f4c2c37fc8972d81', '2018-03-30 08:10:27', '<!DOCTYPE html><html xmlns=\"http://www.w3.org/1999/xhtml\" style=\"\" class=\" js flexbox flexboxlegacy canvas canvastext webgl no-touch geolocation postmessage websqldatabase indexeddb hashchange history draganddrop websockets rgba hsla multiplebgs backgroundsize borderimage borderradius boxshadow textshadow opacity cssanimations csscolumns cssgradients cssreflections csstransforms csstransforms3d csstransitions fontface generatedcontent video audio localstorage sessionstorage webworkers applicationcache svg inlinesvg smil svgclippaths js csstransforms csstransforms3d csstransitions responsejs \"><head>\n        <title>{subject}</title>\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n        <style type=\"text/css\" media=\"only screen and (max-width: 480px)\">\n            /* Mobile styles */\n            @media only screen and (max-width: 480px) {\n                [class=\"w320\"] {\n                    width: 320px !important;\n                }\n                [class=\"mobile-block\"] {\n                    width: 100% !important;\n                    display: block !important;\n                }\n            }\n        </style>\n                                      </head>\n    <body style=\"margin: 0px; cursor: auto;\" class=\"ui-sortable\">\n        <div data-section-wrapper=\"1\">\n            <center>\n                <table data-section=\"1\" style=\"width: 600;\" width=\"600\" cellpadding=\"0\" cellspacing=\"0\">\n                    <tbody>\n                        <tr>\n                            <td>\n                                <div data-slot-container=\"1\" style=\"min-height: 30px\" class=\"ui-sortable\">\n                                    <div data-slot=\"text\"><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">        Dear {contactfield=firstname};</span></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">      Mình là Trang - Chuyên viên Nhân sự phụ trách mảng Tuyển dụng của <strong>công ty Cổ Phần Dịch Vụ Truyền thông Đa Phương Tiện Việt Nam (VMMS)</strong>. Công ty mình hoạt động trong<strong> lĩnh vực phần mềm chuyên cung cấp các giải pháp cho hệ thống website thương mại điện tử.</strong></span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">       Hiện nay, công ty VMMS đang không ngừng mở rộng quy mô và thị trường với nhiều khách hàng đến từ Mỹ, Úc ,Pháp, Singapore...Vì vậy, VMMS đang có đợt tuyển dụng mới với 5 vị trí <strong>Chuyên viên Nhận dự án Website trong nước và nước ngoài </strong>(VMMS tuyển cả vị trí thực tập, nếu bạn chưa có kinh nghiệm sẽ được đào tạo thêm).</span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">      Trường <strong>Đại học Hà Nội (HANU)</strong> được biết đến là một trong những trường có chương trình đạo tạo CNTT bậc đại học bằng tiếng Anh tốt nhất Hà Nội. Với kiến thức về CNTT cũng như nền tảng Tiếng Anh tốt, sinh viên HANU rất thích hợp với vị trí <strong>Chuyên viên </strong><strong>Nhận dự án Website trong nước và nước ngoài</strong> – người hỗ trợ, làm cầu nối giữa khách hàng với doanh nghiệp – đây là vị trí mà VMMS đang rất cần và mong muốn có thể được hợp tác với các bạn sinh viên năng động của trường <strong>Đại học Hà Nội</strong>.</span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>MÔ TẢ CÔNG VIỆC:</strong></span></span></span></div><ul type=\"disc\"><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Nghiên cứu phân tích các yêu cầu dự án và gửi cho Bộ phận Lập trình để xúc tiến dự án.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Lập bảng báo giá cho khách hàng.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Trao đổi, tư vấn, chăm sóc các khách hàng trong việc thiết kế, xây dựng website (sẽ được trợ giúp và hướng dẫn thêm trong quá trình làm việc).</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Làm việc, phối hợp công việc theo nhóm dưới sự phân công của quản lý dự án.</span></span></span></li></ul><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>QUYỀN LỢI ĐƯỢC HƯỞNG:</strong></span></span></span></div><ul type=\"disc\"><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Công việc năng động, sáng tạo với các dự án hiện đại, đa dạng của nước ngoài,</strong> thường xuyên có cơ hội gặp gỡ và làm việc với các khách hàng trong và ngoài nước.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Môi trường làm việc thân thiện, thoải mái.</strong></span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Được học tập, phát triển nâng cao trình độ ngoại ngữ (tiếng Anh) và kỹ năng chuyên môn</strong>, có nhiều cơ hội thăng tiến trong công việc (có cơ hội trở thành nhân viên chính thức đối với vị trí thực tập).</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Lương cơ bản + thưởng dự án </strong><strong>(tổng thu nhập </strong><strong>từ 4 - 7 triệu với Junior Position, từ 7 - 25 triệu với Senior Position)</strong></span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Có trợ cấp đối với vị trí Thực tập</strong></span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Thưởng các ngày nghỉ Lễ, Tết, lương tháng 13</strong> và các chế độ phúc lợi, chế độ bảo hiểm theo quy định của Nhà nước.</span></span></span></li></ul><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>YÊU CẦU CHUNG:</strong></span></span></span></div><ul type=\"disc\"><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Có khả năng tiếp thu nhanh, sẵn sàng thử nghiệm cái mới.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Có khả năng đọc hiểu tài liệu tiếng Anh tốt.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Kỹ năng giao tiếp tự tin và có khả năng truyền đạt dễ hiểu.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Có hiểu biết về các ngôn ngữ lập trình và các phần mềm thiết kế đồ họa, Photoshop là một lợi thế.</span></span></span></li></ul><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Để nắm rõ thông tin công ty và mô tả cụ thể về vị trí cần tuyển, mời {contactfield=firstname} tham khảo link dưới đây: </span></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><a href=\"{trackable=1814e1b385150fa9bc28d46e0}\">http://vmms.vn/chung-toi/chuyen-vien-nhan-da.html</a></span></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">{contactfield=firstname} có thể tìm hiểu nhiều hơn về chúng mình tại website: <a href=\"{trackable=1d085bcdf47fa1fdb34a2e92f}\">http://vmms.vn/</a></span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>CÁCH THỨC ỨNG TUYỂN:</strong></span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">{contactfield=firstname} quan tâm gửi CV theo địa chỉ email: <strong>hr@vicoders.com </strong><em>(Tiêu đề ghi rõ Họ tên – Vị trí ứng tuyển)</em></span><div style=\"text-align: justify;\"><span style=\"font-size: 14px;\">Mọi thắc mắc cần hỗ trợ vui lòng liên hệ:</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 14px;\">Phòng Hành chính – Nhân sự: 096.392.4242 <em>(liên hệ giờ hành chính)</em></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><strong>Công ty Cổ phần Truyền thông Đa phương tiện Việt Nam</strong></span></div><span style=\"font-size: 14px;\"><strong>Địa chỉ: Tầng 2, số 42, ngõ 178, Thái Hà, Đống Đa, Hà Nội.</strong><br /></span><br /><span style=\"font-size: 14px;\"><br /><div style=\"text-align: right;\"><em><strong>Chúng mình rất mong nhận được hồi âm sớm từ {contactfield=firstname} !</strong></em></div><div style=\"text-align: right;\"><em><strong>Phòng Hành chính – Nhân sự VMMS</strong></em></div></span></span></span></div><div data-slot=\"image\" data-param-align=\"2\" style=\"text-align: right;\">\n<img src=\"http://hrautomail.vicoders.com/media/images/070777edb0b357806f77fb73534adf3b.png\" alt=\"An image\" class=\"fr-view\" style=\"\" /><br />\n<div style=\"clear:both\"></div>\n                                </div>\n                                </div>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </center>\n        </div>\n<img height=\"1\" width=\"1\" src=\"{tracking_pixel}\" alt=\"\" /></body></html>', 'Thư ngỏ mời ứng tuyển từ VMMS'),
('81085b78ab9cead8131e095767241a58', '2018-03-29 06:40:48', '<!DOCTYPE html><html xmlns=\"http://www.w3.org/1999/xhtml\" style=\"\" class=\" js flexbox flexboxlegacy canvas canvastext webgl no-touch geolocation postmessage websqldatabase indexeddb hashchange history draganddrop websockets rgba hsla multiplebgs backgroundsize borderimage borderradius boxshadow textshadow opacity cssanimations csscolumns cssgradients cssreflections csstransforms csstransforms3d csstransitions fontface generatedcontent video audio localstorage sessionstorage webworkers applicationcache svg inlinesvg smil svgclippaths js csstransforms csstransforms3d csstransitions responsejs \"><head>\n        <title>{subject}</title>\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n        <style type=\"text/css\" media=\"only screen and (max-width: 480px)\">\n            /* Mobile styles */\n            @media only screen and (max-width: 480px) {\n                [class=\"w320\"] {\n                    width: 320px !important;\n                }\n                [class=\"mobile-block\"] {\n                    width: 100% !important;\n                    display: block !important;\n                }\n            }\n        </style>\n                                      </head>\n    <body style=\"margin: 0px; cursor: auto;\" class=\"ui-sortable\">\n        <div data-section-wrapper=\"1\">\n            <center>\n                <table data-section=\"1\" style=\"width: 600;\" width=\"600\" cellpadding=\"0\" cellspacing=\"0\">\n                    <tbody>\n                        <tr>\n                            <td>\n                                <div data-slot-container=\"1\" style=\"min-height: 30px\" class=\"ui-sortable\">\n                                    <div data-slot=\"text\"><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">        Dear {contactfield=firstname};</span></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">      Mình là Trang - Chuyên viên Nhân sự phụ trách mảng Tuyển dụng của <strong>công ty Cổ Phần Dịch Vụ Truyền thông Đa Phương Tiện Việt Nam (VMMS)</strong>. Công ty mình hoạt động trong<strong> lĩnh vực phần mềm chuyên cung cấp các giải pháp cho hệ thống website thương mại điện tử.</strong></span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">       Hiện nay, công ty VMMS đang không ngừng mở rộng quy mô và thị trường với nhiều khách hàng đến từ Mỹ, Úc ,Pháp, Singapore...Vì vậy, VMMS đang có đợt tuyển dụng mới với 5 vị trí <strong>Chuyên viên Nhận dự án Website trong nước và nước ngoài </strong>(VMMS tuyển cả vị trí thực tập, nếu bạn chưa có kinh nghiệm sẽ được đào tạo thêm).</span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">      Trường <strong>Đại học Hà Nội (HANU)</strong> được biết đến là một trong những trường có chương trình đạo tạo CNTT bậc đại học bằng tiếng Anh tốt nhất Hà Nội. Với kiến thức về CNTT cũng như nền tảng Tiếng Anh tốt, sinh viên HANU rất thích hợp với vị trí <strong>Chuyên viên </strong><strong>Nhận dự án Website trong nước và nước ngoài</strong> – người hỗ trợ, làm cầu nối giữa khách hàng với doanh nghiệp – đây là vị trí mà VMMS đang rất cần và mong muốn có thể được hợp tác với các bạn sinh viên năng động của trường <strong>Đại học Hà Nội</strong>.</span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>MÔ TẢ CÔNG VIỆC:</strong></span></span></span></div><ul type=\"disc\"><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Nghiên cứu phân tích các yêu cầu dự án và gửi cho Bộ phận Lập trình để xúc tiến dự án.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Lập bảng báo giá cho khách hàng.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Trao đổi, tư vấn, chăm sóc các khách hàng trong việc thiết kế, xây dựng website (sẽ được trợ giúp và hướng dẫn thêm trong quá trình làm việc).</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Làm việc, phối hợp công việc theo nhóm dưới sự phân công của quản lý dự án.</span></span></span></li></ul><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>QUYỀN LỢI ĐƯỢC HƯỞNG:</strong></span></span></span></div><ul type=\"disc\"><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Công việc năng động, sáng tạo với các dự án hiện đại, đa dạng của nước ngoài,</strong> thường xuyên có cơ hội gặp gỡ và làm việc với các khách hàng trong và ngoài nước.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Môi trường làm việc thân thiện, thoải mái.</strong></span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Được học tập, phát triển nâng cao trình độ ngoại ngữ (tiếng Anh) và kỹ năng chuyên môn</strong>, có nhiều cơ hội thăng tiến trong công việc (có cơ hội trở thành nhân viên chính thức đối với vị trí thực tập).</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Lương cơ bản + thưởng dự án </strong><strong>(tổng thu nhập </strong><strong>từ 4 - 7 triệu với Junior Position, từ 7 - 25 triệu với Senior Position)</strong></span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Có trợ cấp đối với vị trí Thực tập</strong></span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>Thưởng các ngày nghỉ Lễ, Tết, lương tháng 13</strong> và các chế độ phúc lợi, chế độ bảo hiểm theo quy định của Nhà nước.</span></span></span></li></ul><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>YÊU CẦU CHUNG:</strong></span></span></span></div><ul type=\"disc\"><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Có khả năng tiếp thu nhanh, sẵn sàng thử nghiệm cái mới.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Có khả năng đọc hiểu tài liệu tiếng Anh tốt.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Kỹ năng giao tiếp tự tin và có khả năng truyền đạt dễ hiểu.</span></span></span></li><li style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Có hiểu biết về các ngôn ngữ lập trình và các phần mềm thiết kế đồ họa, Photoshop là một lợi thế.</span></span></span></li></ul><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">Để nắm rõ thông tin công ty và mô tả cụ thể về vị trí cần tuyển, mời {contactfield=firstname} tham khảo link dưới đây: </span></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><a href=\"{trackable=1814e1b385150fa9bc28d46e0}\">http://vmms.vn/chung-toi/chuyen-vien-nhan-da.html</a></span></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">{contactfield=firstname} có thể tìm hiểu nhiều hơn về chúng mình tại website: <a href=\"{trackable=1d085bcdf47fa1fdb34a2e92f}\">http://vmms.vn/</a></span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><div style=\"text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\"><strong>CÁCH THỨC ỨNG TUYỂN:</strong></span></span></span></div><div data-empty=\"true\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><br /></span></span></div><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Times New Roman,Times,serif;\"><span style=\"font-size: 14px;\">{contactfield=firstname} quan tâm gửi CV theo địa chỉ email: <strong>hr@vicoders.com </strong><em>(Tiêu đề ghi rõ Họ tên – Vị trí ứng tuyển)</em></span><div style=\"text-align: justify;\"><span style=\"font-size: 14px;\">Mọi thắc mắc cần hỗ trợ vui lòng liên hệ:</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 14px;\">Phòng Hành chính – Nhân sự: 096.392.4242 <em>(liên hệ giờ hành chính)</em></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><strong>Công ty Cổ phần Truyền thông Đa phương tiện Việt Nam</strong></span></div><span style=\"font-size: 14px;\"><strong>Địa chỉ: Tầng 2, số 42, ngõ 178, Thái Hà, Đống Đa, Hà Nội.</strong><br /></span><br /><span style=\"font-size: 14px;\"><br /><div style=\"text-align: right;\"><em><strong>Chúng mình rất mong nhận được hồi âm sớm từ {contactfield=firstname} !</strong></em></div><div style=\"text-align: right;\"><em><strong>Phòng Hành chính – Nhân sự VMMS</strong></em></div></span></span></span></div><div data-slot=\"image\" data-param-align=\"2\" style=\"text-align: right;\">\n<img src=\"http://hrautomail.vicoders.com/media/images/070777edb0b357806f77fb73534adf3b.png\" alt=\"An image\" class=\"fr-view\" style=\"\" /><br />\n<div style=\"clear:both\"></div>\n                                </div>\n                                </div>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </center>\n        </div>\n<img height=\"1\" width=\"1\" src=\"{tracking_pixel}\" alt=\"\" /></body></html>', 'Thư ngỏ mời tuyển dụng từ VMMS'),
